render(){
    return(
        <div class="header_left">
        <div class ="logo">
        <img src="LOGO coba.png" /></div>
        </div>
    )

}}

class Nav extends React.Component {
        state = {
            click: false
        }

        render(){
            return(
                <div class="header_right">
                    <a class="navbar_tombol" onClick={() => {this.setState({ click: !this.state.click })}}>â‰¡</a>
                    {this.state.click ? <Isi_nav /> : null}
                </div>
            );
        }
    }


    function Li(props){
    return (
        <div class={props.div}>
        <li> <a href= {props.link} ><span> {props.text} </span> <figure class={props.figure_class}><img src={props.img}/><figcaption class={props.figcaption_class}><span> <strong>{props.judul}</strong><br/> <br/>{props.starting} <br/><strong>{props.harga} </strong><br/><br/> {props.tanggal} <br/> {props.jam} <br/> {props.tempat}</span></figcaption></figure></a> </li></div>
    )
}
function Li2(props){
    return (
        <div class={props.div}>
        <li> <a href= {props.link} ><span> {props.text} </span></a> </li></div>
    )
}
function Select(props){
    return (

        <option value={props.value}>{props.text}</option>
    )
}
